import React from 'react'
import { Container } from 'react-bootstrap';

class Dbms extends React.Component {
    render() {
        return (
            <div>
                <Container>
                    <h1> Computer Science & Engineering</h1>
                    <h4>Database Management System</h4>

                    <ul>
                        <a href='https://previousyrpaper.s3.ap-south-1.amazonaws.com/cse/3rd+sem/even/DBMS/MSE-I-DBMS.pdf'>
                            <li>2021-mse1</li>
                        </a>
                    </ul>
                </Container>

            </div>
        );
    }
}

export default Dbms;
